V8:
Ipotekaya yararli!!!
Yasamal rayonu İnşaatçilar metrosunun düz çixişinda yeni tikili 14 mərtəbəli binanin 5-ci mərtəbəsində 1 otaqdan 2 otaga duzəlmə mənzil satilir.Təmir zamanı ən keyfiyyətli materiallardan istifadə olunmuşdur.KUPÇA( ÇİXARİŞ) var.
-hər blokda – bir sərnişin və bir yük səssiz, rahat liftlər;
-müasir yanğın siqnalizasiya sistemi;
-yüksək səviyyəli texnoloji avadanlıqla;
-hər blok girişində domofonlarla.
Kompleksin yaxınlığında müxtəlif mağazalar,məktəblər,uşaq bağçalari,ticarət mərkəzləri,bank şöbələri və s.yerləşir.
Firmaya alici tərəfindən 1% ödəniş olunacaq.
Qeyd: Menzili alib kiraye vermek ucun ideal variantdir. Minimum 450 azn.
